INSERT INTO `gallery_images` VALUES
(2,'Dhaka South City Corporation (DSCC) and Global Alliance for Incinerator Alternatives (GAIA ) at Nagar Bhaban (DSCC), focusing on ‚ÄúZero Waste Investment: Integrating Zero Waste Finance into National and Local Budgets.‚Äù','A City-Level Round Table was organized by the Environment and Social Development Organization- ESDO in collaboration with Dhaka South City Corporation (DSCC) and Global Alliance for Incinerator Alternatives (GAIA ) at Nagar Bhaban (DSCC), focusing on ‚ÄúZero Waste Investment: Integrating Zero Waste Finance into National and Local Budgets.‚Äù\nThe meeting brought together local administrators, bureaucrats, policymakers, and members of GAIA to discuss strategies for integrating zero waste finance into national and local development frameworks.\nJoining online, Climate Policy Officer Mr. Yobel Novian Putra, from GAIA highlighted the waste management challenges and solutions in South Asia. He emphasized that achieving zero waste is possible in Asian countries, citing the example of the Philippines, which has successfully reduced 80% of its landfill waste through effective zero waste practices.\nRepresentatives from Dhaka South City Corporation shared their recent initiatives and ongoing efforts toward sustainable waste management.\nDr. Shahriar Hossain, Secretary General of ESDO, noted that while achieving zero waste is challenging, it is not impossible. He emphasized that the lack of internal coordination remains a major obstacle to realizing zero-waste goals. \nChief Waste Management Officer of Dhaka South City Corporation, Air Commodore Md. Mahabubur Rahman Talukder, OSP, BPP, psc, Admin; Chief Waste Management Officer of Dhaka North City Corporation, Commodore Mohammad Humayun Kabir; and Additional Director General (CC) of the Department of Environment (DoE), Md. Ziaul Haque, attended the Round Table and shared their insights. Ms Sumana Narayanan, Deputy Director for Programs at GAIA Asia Pacific, also participated in the program virtually.','https://res.cloudinary.com/djeguy5v5/image/upload/v1769916903/clean-care/complaints/2026-02-01/xpkkcgabw9xee6fb1mcn.jpg','ACTIVE',0,72,'2026-02-01 03:35:09.469','2026-02-18 09:49:34.917'),
(3,'DSCC Waste Management system for the future.','Waste management is a challenging issue for Dhaka the capital city of Bangladesh. Dhaka South City Corporation is trying their best to keep the city clean.','https://res.cloudinary.com/djeguy5v5/image/upload/v1769917537/clean-care/complaints/2026-02-01/avbco9pogjlywjmvfh6r.jpg','ACTIVE',1,72,'2026-02-01 03:45:47.239','2026-02-18 09:49:34.917');
